## Meta - OS:   Windows 7  Selenium Version:   3.5.2  Geckodriver Version: 0.18.0  Browser:   Firefox 54  Really weird issue here where I attempt to launch a Firefox instance through Grid and get the following error in the Grid log:  `org.openqa.selenium.WebDriverException: unknown error: cannot find Chrome binary`  ## Expected Behavior - Firefox instance is launched on node  ## Actual Behavior - The following exception returned on hub: `org.openqa.selenium.WebDriverException: unknown error: cannot find Chrome binary`  Despite the fact I do not have Chrome mentioned anywhere in my configuration and it is not installed on the node.  ## Steps to reproduce - **Hub config**: ``` {   "port": 4445,   "newSessionWaitTimeout": -1,   "servlets" : [],   "withoutServlets": [],   "custom": {},   "capabilityMatcher": "org.openqa.grid.internal.utils.DefaultCapabilityMatcher",   "throwOnCapabilityNotPresent": true,   "cleanUpCycle": 5000,   "role": "hub",   "debug": false,   "browserTimeout": 0,   "timeout": 1800 } ```  **Hub start batch**: `java -cp "lib\*;selenium-server-standalone-3.5.2.jar" org.openqa.grid.selenium.GridLauncherV3 -role hub -hubConfig "C:\selenium\hubConfig-3.5.2.json" >"C:\selenium\logs-3.5.2\hub.log" 2>"C:\selenium\logs-3.5.2\hub.error.log" `  **Node config**: ``` {   "capabilities":   [     {       "browserName": "firefox",       "maxInstances": 5,       "seleniumProtocol": "WebDriver",       "version": "54",       "firefox_binary":"C:\Program Files\Mozilla Firefox\firefox.exe"     }   ],   "proxy": "org.openqa.grid.selenium.proxy.DefaultRemoteProxy",   "maxSession": 5,   "port": 5555,   "register": true,   "registerCycle": 5000,   "hub": "http://hubhost4445",   "nodeStatusCheckTimeout": 5000,   "nodePolling": 5000,   "role": "node",   "unregisterIfStillDownAfter": 60000,   "downPollingLimit": 2,   "debug": false,   "servlets" : [],   "withoutServlets": [],   "custom": {} } ```  **Node starter batch**: `java -Dwebdriver.gecko.driver="C:\selenium\geckodriver.exe" -jar selenium-server-standalone-3.5.2.jar -role node -nodeConfig "C:\selenium
odeConfig_3.5.2.json" -debug `  Code: ``` @Test 	public void findMarionetteOnGithub() throws MalformedURLException {  		System.setProperty("webdriver.gecko.driver", "C:\temp\geckodriver.exe"); 		DesiredCapabilities capabilities = new DesiredCapabilities(); 		capabilities.setCapability("marionette", true); 		WebDriver driver = new RemoteWebDriver(new URL("http://hubhost:4445/wd/hub"), capabilities); 		WebDriverWait wait = new WebDriverWait(driver, 10); 		driver.close();  	}  ```  **Debug output on hub**:  ``` 11:09:35.234 DEBUG - Memory-based payload for: {desiredCapabilities={marionette=true}, capabilities={firstMatch=[], desiredCapabilities={marionette=true}, alwaysMatch={}, requiredCapabilities={}}, requiredCapabilities={}} 11:09:35.235 INFO - Mismatched capabilities. Creating a synthetic w3c capability. 11:09:35.235 INFO - Got a request to create a new session: Capabilities [{marionette=true}] 11:09:35.236 DEBUG - Available nodes: [http://nodehost:5555] 11:09:35.236 DEBUG - Trying to create a new session on node http://nodehost:5555 11:09:35.236 INFO - Trying to create a new session on test slot {seleniumProtocol=WebDriver, firefox_binary=C:\Program Files\Mozilla Firefox irefox.exe, browserName=firefox, maxInstances=5, version=54, platform=VISTA} 11:09:35.236 DEBUG - Closing connections idle longer than 100 MILLISECONDS 11:09:35.236 DEBUG - http-outgoing-536: Close connection 11:09:35.237 DEBUG - CookieSpec selected: default 11:09:35.238 DEBUG - Auth cache not set in the context 11:09:35.238 DEBUG - Connection request: [route: {}->http://nodehost:5555][total kept alive: 0; route allocated: 0 of 2000; total allocated: 0 of 2000] 11:09:35.238 DEBUG - Connection leased: [id: 537][route: {}->http://nodehost:5555][total kept alive: 0; route allocated: 1 of 2000; total allocated: 1 of 2000] 11:09:35.238 DEBUG - Opening connection {}->http://nodehost:5555 11:09:35.238 DEBUG - Connecting to /nodehost:5555 11:09:35.239 DEBUG - Connection established hubhost:57503nodehost: